import React, { useState } from 'react';

function App() {
  // 定义状态用于存储整个响应数据
  const [data, setData] = useState(null);

  // 点击事件处理函数
  const handleClick = async () => {
    try {
      // 发起网络请求获取数据（替换为实际 URL）
      const response = await fetch('http://220.88.39.23:5000/api/user/token?username=test123');
      if (!response.ok) {
        throw new Error('网络请求失败');
      }
      const result = await response.json();
      // 将整个结果存入状态
      setData(result);
    } catch (error) {
      console.error('请求错误:', error);
    }
  };

  return (
    <div>
      <button onClick={handleClick}>获取数据</button>

      <div>
        <h3>获取到的数据：</h3>
        {data ? (
          <pre>{JSON.stringify(data, null, 2)}</pre>
        ) : (
          <p>尚未获取数据</p>
        )}
      </div>
    </div>
  );
}

export default App;
